MongoDB matching array against value in nested documents<p>I have searched around this problem I am facing for a bit but I haven't found a good solution without using the $lookup parameter.</p>
<p>My Documents currently roughly look like this:</p>
<pre><code>{
    ...
    problems:
        [ { ... id: 1, ...}, { ... id: 7, ...}, { ... id: 122, ...} ],
    solutions:
        [ { ... assignedProblems: [1, 7] ... }, { ... assignedProblems: [122] ...} ],
    ... 
}
</code></pre>
<p>I am now trying to match the <code>assignedProblems</code> array with the <code>id</code> in <code>problems</code>.</p>
<p>My current aggregation looks like this:</p>
<pre><code>{
    $unwind: {
        path: &quot;$solutions&quot;
    },
    $lookup: {
        from: &quot;problems&quot;,
        localField: &quot;solutions.assignedProblems&quot;,
        foreignField: &quot;id&quot;,
        as: &quot;problems&quot;
    }
}
</code></pre>
<p>This aggregation works flawlessly but is painfully slow, even when using indexes.</p>
<p>I have tried to replace the $lookup with following:</p>
<pre><code>    $match: {
        $expr: {
            $setEquals: [&quot;$solutions.assignedProblems&quot;, &quot;$problems.id&quot;]
        }
     }
</code></pre>
<p>But this does only work if the amount of problems is the same as the elements in the assignedProblems array. This is the same case when using the $eq operator.</p>
<p>Is there any other way to match these id's with the array?</p>

