Any functionality in a MongoDB Aggregation like a simple "regex replace"?<p>I'm trying to create a step in a MongoDB aggregation pipeline which will replace the value of a full Social Security Number (like <code>&quot;123-45-6789&quot;</code>) with a masked value, preserving the last four digits (like <code>&quot;XXX-XX-6789&quot;</code>).</p>
<p>I see <code>$replaceAll</code> and <code>$replaceOne</code> but it looks like those only accept string literals, not regex expressions. I see there is a regex find that looks like it can very clumsily fit into a replace stage:</p>
<pre class="lang-js prettyprint-override"><code>&quot;maskedSsn&quot; : {
    &quot;$replaceOne&quot; : { 
        &quot;input&quot; : &quot;$ssn&quot;,
        &quot;find&quot; : { 
            &quot;$regexFind&quot; : { 
                &quot;input&quot; : &quot;$ssn&quot;, 
                &quot;regex&quot; : &quot;\\d{3}-\\d{2}\\-&quot;
            }
        },
        &quot;replacement&quot; : &quot;XXX-XX-&quot;
    }
}
</code></pre>
<p>But with this I get the error <code>&quot;$replaceOne requires that 'find' be a string, found: {match: \&quot;000-00-\&quot;, idx: 0, captures: []}</code> (the SSN is mocked, random data here). I'm not sure how to just get the <code>&quot;match&quot;</code> out of the resultant object as part of this step. I <em>could</em> add this regex match as a different field, then get the match in this stage of my aggregation for a simple string replacement, but I would prefer to keep all the logic in one step if possible.</p>
<p>It's hard for me to believe that this isn't possible in one step, with something like a regex replace (which is a feature of every language I've used). Is there a functionality that I'm missing?</p>

