Typescript object keys type with recursive subobject adresses, like mongoDb filter<p>Let's say I have a model:</p>
<pre class="lang-js prettyprint-override"><code>type MyModel = {
  string: string
  subObject: {
    subObjString: string
  }
}
</code></pre>
<p>I would like to have a type so all those tests passes:</p>
<ul>
<li>✅ <code>{ string: 'foo' }</code></li>
<li>✅ <code>{ subObject: { subObjString: 'foo'} }</code></li>
<li>✅ <code>{ 'subObject.subObjString': 'foo' }</code></li>
<li>❌ <code>{ 'subObject.notExistingprop': 'foo' }</code></li>
<li>❌ <code>{ notExisting: 'foo' }</code></li>
</ul>
