How to create a dropdownmenu using compose and monogDb?<p>I have been trying a while now to figure out how to make a dropdownmenu using jetpack compose and mongoDb. It would be a simple dropdownmenu with 3 options and whatever the user picks will be registred into monog database. If the user changes their option, the information will be updated in mongodb as well. How can I achieve this feature? Appreciate any feedback!</p>
<p>A more simple dropdownmenu would also work.</p>
<p>Basic dropdownmenu: <a href="https://gyazo.com/9b9901b4f03ec0b01b5869b5cfaffd86" rel="nofollow noreferrer">https://gyazo.com/9b9901b4f03ec0b01b5869b5cfaffd86</a></p>
<pre><code>DropDownMenu:

@OptIn(ExperimentalMaterial3Api::class)
@Composable
fun AnimalLargeDropdownMenu(
    modifier: Modifier = Modifier,
    enabled: Boolean = true,
    label: String,
    notSetLabel: String? = null,
    onItemClicked: () -&gt; String,
    items: RealmList&lt;String&gt;,
    selectedIndex: Int = -1,
    onItemSelected: (index: Int, item: String) -&gt; Unit,
    selectedItemToString: (String) -&gt; String = { it },
    drawItem: @Composable (String, Boolean, Boolean, () -&gt; Unit) -&gt; Unit = { item, selected, itemEnabled, onClick -&gt;
        AnimalLargeDropdownMenuItem(
            text = item,
            selected = selected,
            enabled = itemEnabled,
            onClick = onClick,
        )
    },
) {
    var expanded by remember { mutableStateOf(false) }

    Box(modifier = modifier.height(IntrinsicSize.Min)) {
        OutlinedTextField(
            label = { Text(label) },
            value = items.getOrNull(selectedIndex)?.let { selectedItemToString(it) } ?: &quot;&quot;,
            enabled = enabled,
            modifier = Modifier.fillMaxWidth(),
            trailingIcon = {
                ExposedDropdownMenuDefaults.TrailingIcon(expanded = expanded)
            },
            onValueChange = { },
            readOnly = true,
        )

        // Transparent clickable surface on top of OutlinedTextField
        Surface(
            modifier = Modifier
                .fillMaxSize()
                .padding(top = 8.dp)
                .clip(MaterialTheme.shapes.extraSmall)
                .clickable(enabled = enabled) { expanded = true },
            color = Color.Transparent,
        ) {}
    }

    if (expanded) {
        Dialog(
            onDismissRequest = { expanded = false },
        ) {
            Surface(
                shape = RoundedCornerShape(12.dp),
            ) {
                val listState = rememberLazyListState()
                if (selectedIndex &gt; -1) {
                    LaunchedEffect(&quot;ScrollToSelected&quot;) {
                        listState.scrollToItem(index = selectedIndex)
                    }
                }

                LazyColumn(modifier = Modifier.fillMaxWidth(), state = listState) {
                    if (notSetLabel != null) {
                        item {
                            AnimalLargeDropdownMenuItem(
                                text = notSetLabel,
                                selected = false,
                                enabled = false,
                                onClick = { onItemClicked.invoke()},
                            )
                        }
                    }
                    itemsIndexed(items) { index, item -&gt;
                        val selectedItem = index == selectedIndex
                        drawItem(
                            item,
                            selectedItem,
                            true
                        ) {
                            onItemSelected(index, item)
                            expanded = false
                        }

                        if (index &lt; items.lastIndex) {
                            Divider(modifier = Modifier.padding(horizontal = 16.dp))
                        }
                    }
                }
            }

        }
    }
}

@Composable
fun AnimalLargeDropdownMenuItem(
    text: String,
    selected: Boolean,
    enabled: Boolean,
    onClick: () -&gt; Unit,
) {
    val contentColor = when {
        !enabled -&gt; MaterialTheme.colorScheme.onSurface.copy(alpha = DefaultAlpha)
        selected -&gt; MaterialTheme.colorScheme.primary.copy(alpha = DefaultAlpha)
        else -&gt; MaterialTheme.colorScheme.onSurface.copy(alpha = DefaultAlpha)
    }

    CompositionLocalProvider(LocalContentColor provides contentColor) {
        Box(modifier = Modifier
            .clickable(enabled) { onClick() }
            .fillMaxWidth()
            .padding(16.dp)) {
            Text(
                text = text,
                style = MaterialTheme.typography.titleSmall,
            )
        }
    }
}
</code></pre>

